    (x_min, y_min, z_min) = cube_origin
    x_max = x_min - cube_size
    y_max = y_min + cube_size
    z_max = z_min + cube_size
    (x, y, z) = point
    if x_min <= x <= x_max and y_min <= y <= y_max and (z_min <= z <= z_max):
        return True
    else:
        return False

